Flutter doesn’t manage and share the state of applications, but Flutter developers have a number of options to do so. The simplest is using stateful widgets. A stateful widget has an associated state class where state properties are stored, and state is shared with children of the widget by passing it down through constructors and such. Child widgets can communicate with the parent through callbacks.

Another popular option is to use the Provider package. With this approach, devs create state models and Provider handles making them available to Flutter widgets. Combined with Flutter’s own ChangeNotifier, these state models can also trigger widget rebuilds on state changes.

For more advanced state management, there is the BLoC pattern, MobX, or Redux. There are a number of different implementations of each of these (especially BLoC), and getting into the specifics of each is beyond the scope of a answer. The main feature of all these approaches is their use of immutable state data the flows in just one direction. (MobX may work a bit differently. I’m not as familiar with that one.).
